import { Carousel, CarouselItem, Image, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import { useState } from "react";
import img1 from "assets/images/bg-about-us.jpg"
import img2 from "assets/images/bg-about-uss.jpg"


const Carrusel = () => {
  const [images] = useState([
    {
      id: 2,
      title: "Comienzos de integración a invernadero",
      src: {img1},
    },
    {
      id: 3,
      title: "Forma ejemplificada del invernadero",
      src: {img2},
    },
  ]);

  return (
    <Container>
      <Carousel>
        {images.map((image) => (
          <CarouselItem key={image.id}>
            <Image src={image.src} alt={image.title} style={{ height: "35vw", width: "100%" }} />
            <Carousel.Caption>
              <h3>{image.title}</h3>
            </Carousel.Caption>
          </CarouselItem>
        ))}
      </Carousel>
    </Container>
  );
};

export default Carrusel;
